def get_perfect_numbers(n):
    """
    Given a positive integer n, return a sorted list of perfect numbers up to n.

    A perfect number is a positive integer that is equal to the sum of its proper positive 
    divisors, that is, the sum of its positive divisors excluding the number itself.

    For example:
    get_perfect_numbers(10) returns [6] # Because 6 is the only perfect number up to 10.
    """
    def is_perfect(num):
        return num == sum(i for i in range(1, num) if num % i == 0)

    return sorted(num for num in range(1, n+1) if is_perfect(num))

