    The function should return the resulted string.
    Examples
    solve("1234") = "4321"
    solve("ab") = "AB"
    solve("#a@C") = "#A@c"
    """
    if not any(char.isalpha() for char in s):
        return s[::-1]
    else:
        return ''.join([char.upper() if char.islower() else char.lower() for char in s])

